        <script>
        document.addEventListener("DOMContentLoaded", initialiser);
            /*variable egypte*/
            var terreEgypte = document.getElementById("terreEgypte");
            var titreEgypte = document.getElementById("egypte");
            var pyramide = document.getElementById("pyramide");
            
            /*variable inde*/
            var terreInde = document.getElementById("terreInde");
            var titreInde = document.getElementById("inde");
            var tajMahal = document.getElementById("tajMahal");
            
            /*variables australie*/
             var terreAustralie = document.getElementById("terreAustralie");
            var titreAustralie = document.getElementById("australie");
            var planche = document.getElementById("planche");
            
            /*variable grece*/
                var terreGrece = document.getElementById("terreGrece");
            var titreGrece = document.getElementById("grece");
            var spartacus = document.getElementById("Spartacus");
            
            /*variables mexique*/
             var terreMexique = document.getElementById("terreMexique");
            var titreMexique = document.getElementById("mexique");
            var sombrero = document.getElementById("sombrero");
            
            /*variable perou*/
             var terrePerou = document.getElementById("terrePerou");
            var titrePerou = document.getElementById("perou");
            var flute = document.getElementById("flute");
            
            function initialiser(evt){
                /*egypte*/
                terreEgypte.addEventListener("mouseover", afficherEgypte);
                pyramide.addEventListener("mouseover", afficherEgypte);
                
                /*inde*/
                 terreInde.addEventListener("mouseover", afficherInde);
                tajMahal.addEventListener("mouseover", afficherInde);
                
                /*australie*/
                terreAustralie.addEventListener("mouseover", afficherAustralie);
                planche.addEventListener("mouseover", afficherAustralie);
                
                /*grece*/
                 terreGrece.addEventListener("mouseover", afficherGrece);
                spartacus.addEventListener("mouseover", afficherGrece);
                
                /*mexique*/
                  terreMexique.addEventListener("mouseover", afficherMexique);
               sombrero.addEventListener("mouseover", afficherMexique);
                
                /*perou*/
                terrePerou.addEventListener("mouseover", afficherPerou);
               flute.addEventListener("mouseover", afficherPerou);
            }
            /*function egypte*/
            function afficherEgypte (evt){
                titreEgypte.style.visibility='visible';
               terreEgypte.addEventListener("mouseleave", effacerEgypte);
                pyramide.addEventListener("mouseleave", effacerEgypte);
                terreEgypte.style.fill='#fff';
            }
                function effacerEgypte(evt){
                    titreEgypte.style.visibility='hidden';
                }
                
                /*functions inde*/
                function afficherInde (evt){
                titreInde.style.visibility='visible';
               terreInde.addEventListener("mouseleave", effacerInde);
                tajMahal.addEventListener("mouseleave", effacerInde);
                }
                function effacerInde(evt){
                    titreInde.style.visibility='hidden';
                }
            
            /*function australie*/
               function afficherAustralie (evt){
                titreAustralie.style.visibility='visible';
               terreAustralie.addEventListener("mouseleave", effacerAustralie);
                planche.addEventListener("mouseleave", effacerAustralie);
                }
                function effacerAustralie(evt){
                    titreAustralie.style.visibility='hidden';
                }
                /*function grece*/
              function afficherGrece (evt){
                titreGrece.style.visibility='visible';
               terreGrece.addEventListener("mouseleave", effacerGrece);
                spartacus.addEventListener("mouseleave", effacerGrece);
                }
                function effacerGrece(evt){
                    titreGrece.style.visibility='hidden';
                }
            
            /*function mexique*/
            function afficherMexique (evt){
                titreMexique.style.visibility='visible';
               terreMexique.addEventListener("mouseleave", effacerMexique);
                sombrero.addEventListener("mouseleave", effacerMexique);
                }
                function effacerMexique(evt){
                    titreMexique.style.visibility='hidden';
                }
            
            /*function perou*/
             function afficherPerou (evt){
                titrePerou.style.visibility='visible';
               terrePerou.addEventListener("mouseleave", effacerPerou);
                flute.addEventListener("mouseleave", effacerPerou);
                }
                function effacerPerou(evt){
                    titrePerou.style.visibility='hidden';
                }
        </script>

